import React, { Component } from "react";
import { Star } from "@material-ui/icons";
class RatingsFilterItems extends Component {
  render() {
    const starRatingNum = [5, 4, 3, 2, 1];
    return (
      <ul>
        {starRatingNum.map((ratingNum, i) => (
          <li key={ratingNum} className="ratings__dropdonw-items p-1">
            <div>
              <input type="checkbox" className="mr-2" />
              {ratingNum}
            </div>
            <span className="ml-2">
              {Array(ratingNum).fill(
                <Star fontSize={"small"} color={"secondary"} />
              )}
            </span>
          </li>
        ))}
      </ul>
    );
  }
}

export default RatingsFilterItems;
